webpackJsonp([0x89c4911ddad5],{529:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Return of the Shadow"}},markdownRemark:{id:"/home/kvalencik/git/rots-site/src/pages/news/001561.md absPath of file >>> MarkdownRemark",html:"<blockquote>\n<p>Message 1561 : Wed Mar 26 (Vakaur)     :: Durin VII and a Host of Dwarves…</p>\n</blockquote>\n<p>In the past years, relations between the northeastern settlements of\nDale and Lake-town have grown increasingly estranged from the Dwarven\nmetropolis of Erebor.  These dwarves, however, are known to withdraw\nfrom political relations without warning or reason; and thus the\ncouncil in Lake-town paid no special regard to this lapse in\ncommunication.</p>\n<p>Quite surprised, then, were the elders of Lake-town when—in the midst\nof a frosty Narvinye morning—they were awakened to an urgent report:\nthe dwarves were moving.  Citizens tending the fertile farm land along\nthe river leading to the Long Lake had sighted a large host of dwarves,\narmed for war, crossing the river and marching south towards the Old\nForest Road.</p>",frontmatter:{title:"News 1561: Durin VII and a Host of Dwarves...",date:"October 09, 2017"}}},pathContext:{path:"/news/1561"}}}});
